import './index.css';
import SideMenu from './components/SideMenu';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Login from './Login';
import Calendar from './pages/Calendar';
import Tasks from './pages/Tasks';
import Energy from './pages/Energy';
import Logout from './Logout';
import Auth0ProviderWithHistory from './auth0Provider';
import axios from 'axios';
import { useAuth0 } from "@auth0/auth0-react";
import React, { useEffect } from 'react';

function App() {

  useEffect(() => {

    const { user } = useAuth0();

    const name = user.sub;

    const res = axios.post('http://localhost:5000/flask', name);

    const data = res.data;
    console.log(data);
  })
  return (
    <Auth0ProviderWithHistory>
      {Send_user}
      <Router>
        <Route path='/' exact component={Login}/>
        <Route path= '/Login' component={Login}/>
        <SideMenu/>
        <Switch>
          <Route path='/pages/Calendar' component={Calendar}/>
          <Route path='/pages/Tasks' component={Tasks}/>
          <Route path='/pages/Energy' component={Energy}/>
          <Route path='/pages/Logout'  component={Logout}/>

        </Switch>
      </Router>
    </Auth0ProviderWithHistory>
  );
}

export default App;
